import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import Modal from '@mui/material/Modal';
import { Avatar } from '@mui/material';
import { useNavigate } from 'react-router-dom';

const style = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: 600,
    bgcolor: 'background.paper',
    border: 'none',
    outline: 'none',
    boxShadow: 24,
    p: 4,
    borderRadius: 4
};

export default function ReplyModal() {
    const [open, setOpen] = React.useState(false);
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);
    const navigate = useNavigate();

    return (
        <div>
            <Modal
                open={true}
                onClose={handleClose}
                aria-labelledby="modal-modal-title"
                aria-describedby="modal-modal-description"
            >
                <Box sx={style}>
                    <div className="flex space-x-5">
                        <Avatar className='cursor-pointer' onClick={() => navigate(`/profile/${6}`)}
                            img="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" alt="https://www.vectorstock.com/royalty-free-vectors/profile-logo-vectors" />
                        <div className="w-full">
                            <div className="flex justify-between items-center">
                                <div className="flex cursor-pointer space-x-2 \">
                                    <span className='font-semibold'>Username name</span>
                                    <span className='text-gray-600'>Username .2m</span>
                                    <img className='ml-2 w-5 h-5' src="data:image/png;base64," />
                                </div>

                            </div>
                            <div className="mt-2">
                                <div onClick={() => navigate('tweet/${}')} className="cursor-pointer" >
                                    <p className="mb-2 p-0">Nice morning with clone witj fjnsnfncsjk jdnkdnddn  jdndks jdnks jdsk</p>
                                </div>

                            </div>
                        </div>

                    </div>
                </Box>
            </Modal>
        </div>
    );
}
